SELECT "TableroSistemaPenal_7"."Año Ingreso" AS "Año Ingreso",   "TableroSistemaPenal_7"."CORTE" AS "CORTE",   "TableroSistemaPenal_7"."PAÍS" AS "PAÍS",   "TableroSistemaPenal_7"."TRIBUNAL" AS "TRIBUNAL",   SUM("TableroSistemaPenal_7"."INGRESOS") AS "sum:INGRESOS:ok" FROM "TableroSistemaPenal_7" WHERE (("TableroSistemaPenal_7"."CORTE" >= '10- ARICA.') AND ("TableroSistemaPenal_7"."CORTE" <= '91- SAN MIGUEL.') AND ("TableroSistemaPenal_7"."CLASE" = 'CAUSAS') AND (("TableroSistemaPenal_7"."Calculation_0640821194248948" IS NULL) OR (("TableroSistemaPenal_7"."Calculation_0640821194248948" >= 'AMENAZAS.') AND ("TableroSistemaPenal_7"."Calculation_0640821194248948" <= 'ROBOS.'))) AND ("TableroSistemaPenal_7"."TIPO" IN ('militar', 'ordinaria'))) GROUP BY "TableroSistemaPenal_7"."Año Ingreso",   "TableroSistemaPenal_7"."CORTE",   "TableroSistemaPenal_7"."PAÍS",   "TableroSistemaPenal_7"."TRIBUNAL" ORDER BY "Año Ingreso";
